import React, { Fragment } from "react"

export default function Search(){
    return (
        <Fragment>
            <div className="mobile">
                <div className="m-search">
                    <input onChange={()=>{return}} placeholder="搜索歌曲，歌手，专辑"/>
                </div>
                <div></div>
            </div>
        </Fragment>
    )
}
